import React from 'react';
import styled from 'styled-components';

const ForecastWrapper = styled.div`
  flex-shrink: 0;
  flex-basis: 90px;
  padding: 10px;
  margin: 0 5px;
  border-radius: 5px;
  background-color: rgba(255, 255, 255, 0.2);
  &:first-child {
    margin-left: 0;
  }
  &:last-child {
    margin-right: 0;
  }
`;

const WeatherIcon = styled.img`
  display: block;
  height: 50px;
  width: 50px;
  margin: 0 auto;
`;

const Text = styled.span`
  color: #FFFFFF;
  display: block;
  font-size: 19px;
  text-align: center
`;

const SmallLabel = styled.h4`
  color: #FFFFFF;
  display: block;
  font-weight: 600;
  font-size: 26px;
  text-align: center;
  padding: 5px 0;
`

const ForecastDay = (props) => {
  const { temp, icon, main } = props
  return (
    <ForecastWrapper>
      <Text align="center">{temp}temp</Text>
      <WeatherIcon src={icon} />
      <SmallLabel>
        {temp}&#176;
      </SmallLabel>
      <SmallLabel>
        {main}
      </SmallLabel>
    </ForecastWrapper>
  )
}

export default ForecastDay;
